import React from 'react'
import { Card } from "./Card"
import Data from "./ItemData"
import "./styles/item.css"
export const Item = () => {
  
  return (
    <>

     
            <div className='container-fluid'>
              {Data.map((item, idx) => {
                return <Card key={idx} imgsrc={item.imgsrc} title={item.title} desc={item.desc}/>
              })}
            </div>
    </>
  )
}
